import React,{useContext}from 'react'
import noteContext from '../context/notes/noteContext';


const Feeeeed = () => {
    const context=useContext(noteContext);
    const {key,notes} = context;
   
    function NoteComponent( notes) {
     console.log(notes)
    }
    
  return (
    <button  onClick={NoteComponent}>test</button>
    
  )
}

export default Feeeeed
